            <div className="bg-img" class="img-fluid" >
                <img className="bg obj-fit-cover" src="https://t4.ftcdn.net/jpg/02/99/31/07/360_F_299310701_KJn20TurXr4q9lrnKH3oRmlLGFvwq8k1.jpg" class="img-fluid" alt="cute kitty" />
            </div>
            {/* <div className="bg-img bg-cover" style={{ backgroundImage: `url('https://www.valleycentral.com/wp-content/uploads/sites/39/2022/07/Cat.jpg?w=2560&h=1440&crop=1')` }}>
            </div> */}
            {/* <Link to='/tdee_calculator'><button>Get Started Today!</button></Link> */}
        </div>
    );
}
export default Welcome;

